import './App.css';
import Navbar from './components/Navbar';
import WeatherApp from './WeatherApp';

function App() {

  return (
    <div className="App bg-default h-screen">
      <header className="App-header sticky top-0 max-w-full mx-auto z-99 xl:items-center">
        <Navbar />
      </header>

      <div className='flex justify-between items-center p-2'>
        <WeatherApp />
      </div>
    </div>
  );
}

export default App;
